import React from 'react';
import {
  Container,
  HeaderContainer,
  Header,
  SkipToContent,
  HeaderName,
  HeaderNavigation,
  HeaderMenuItem,
  HeaderGlobalBar,
  HeaderGlobalAction,
  SideNav,
  SideNavItems,
  SideNavLink,
  SideNavMenu,
  SideNavMenuItem,
  SideNavRail,
  Breadcrumb,
  BreadcrumbItem,
  Button,
  Tabs,
  Tab,
} from 'carbon-components-react';
import PzSidenavSet from "./PzSidenavSet"
import PzSidenavItems from './PzSidenavItems'


const props = {
  tabs: {
    selected: 0,
    role: 'navigation',
  },
  tab: {
    role: 'presentation',
    tabIndex: 0,
  },
};




function PzSidenav() {
  const NavComponents = PzSidenavItems.map(item => <PzSidenavSet key={item.id} title={item.title} icon={item.icon} link={item.link}/>)

  return(
    <div>
      {NavComponents}
    </div>
  )
  }

export default PzSidenav;
